import ScrollableComponent from "../fragments/ScrollableComponent";
import { Grid } from "@mui/material";

export default function Root() {
  return (
    <>
      <TopBar />
      <div id="detail">
        <Outlet />
      </div>
      <Footer />
    </>
  );
}
